import React, {Component} from 'react';

export class AutoClick extends Component {
  constructor(props) {
    super(props)
    this.state = {
      tier: 1,
      cost: 10,
      buttonDisabled: true,
      effectEnabled: false
      }
  }

  x = (y) => {
    let i = 1

    while(i <= y) {
      let a = 1,
          b = 1,
          c = 0

      c = a + b
      a = b
      b = c
      i += 1
      return c
    }
  };

  autoPoke = () => {

    console.log(this.x(this.state.tier))

    this.setState({
      tier: this.state.tier + 1,
      cost: this.state.tier + 1,
      buttonDisabled: true,
      effectEnabled: true
    })
    console.log(this.state)
  }

  render() {
    return (
      <button onClick={this.autoPoke} >Auto Poke {this.state.tier}</button>
    )
  }
}
